        // 개인문서함(Z:) 초기화
        this.fn_getTree_left_init = function()
        {
        	trace("fn_getTree_left_init IN");
        	var getFilePATH = "Z:";
        	
        	this.ds_main_left.clearData();
        	
        	this.ds_main_left.set_enableevent(false);
        	
        	var addRow = this.ds_main_left.addRow();
        	this.ds_main_left.setColumn(addRow, "VIEW_LV", "0");
        	this.ds_main_left.setColumn(addRow, "NAME", "개인문서함 (Z:)");
        	this.ds_main_left.setColumn(addRow, "FULLPATH", getFilePATH);
        	
        	for(var i = 0; i < this.ds_sample_data.rowcount; i++)
        	{
        		if(this.ds_sample_data.getColumn(i, "PARENTPATH")==getFilePATH)
        		{
        			var filePath = this.ds_sample_data.getColumn(i, "FULLPATH");
        			
        			if(this.ds_main_left.findRow("FULLPATH", filePath) < 0)
        			{
        				var addRow = this.ds_main_left.addRow();
        				var lv = filePath.match(/\\/g).length;
        				
        				this.ds_main_left.setColumn(addRow, "VIEW_LV", lv);
        				this.ds_main_left.setColumn(addRow, "NAME", this.ds_sample_data.getColumn(i, "NAME"));
        				this.ds_main_left.setColumn(addRow, "FULLPATH", filePath);
        			}
        			
        			for(var j = 0; j < this.ds_sample_data.rowcount; j++)
        			{
        				if(this.ds_sample_data.getColumn(j, "PARENTPATH")==filePath)
        				{
        					var filePathSub = this.ds_sample_data.getColumn(j, "FULLPATH");
        					
        					if(this.ds_main_left.findRow("FULLPATH", filePathSub) < 0)
        					{
        						var addRowSub = this.ds_main_left.addRow();
        						var lvSub = filePathSub.match(/\\/g).length;
        						
        						this.ds_main_left.setColumn(addRowSub, "VIEW_LV", lvSub);
        						this.ds_main_left.setColumn(addRowSub, "NAME", this.ds_sample_data.getColumn(j, "NAME"));
        						this.ds_main_left.setColumn(addRowSub, "FULLPATH", filePathSub);
        						
        						this.ds_main_left.moveRow(addRowSub,this.ds_main_left.findRow("FULLPATH", filePath) + 1)
        					}
        				}
        			}
        		}
        	}
        	this.ds_main_left.set_enableevent(true);
        	trace("fn_getTree_left_init OUT");
        }

